import { ProductsState, ProductsActions } from './../../types/products';

let initialState: ProductsState = {
    type: 'string',
    id: 0,
    sku: 'string',
    title: 'string',
    regular_price: {
      currency: 'string',
      value: 0
    },
    image: 'string',
    brand: 0,
}

export const productsReducer = (state = initialState, action: ProductsActions ):ProductsState => {
    switch(action.type) {


        default: 
            return {
                ...state,
            }
    }
}
